import React from "react";
import Constants from "expo-constants";
import { Text, View } from "react-native";

const MenuScreen = () => {
  return (
    <View style={{ marginTop: Constants.statusBarHeight, padding: 15 }}>
      <Text>Menu</Text>
    </View>
  );
};

export default MenuScreen;
